import React from 'react'

const Top5PerMonth = ({ top5PerMonth }) => {
    console.log(top5PerMonth);
    top5PerMonth.map((items, index) => {
        return (
            <ul key={index}>
                {Object.keys(items).map((key) => {
                    return (
                        <li key={key + index}>{key}:{items[key]}</li>
                    )
                })}
            </ul>
        )
    })
};

export default Top5PerMonth
